import React from 'react';
import {
  createMuiTheme
} from '@material-ui/core/styles';
import './App.css';

import red from '@material-ui/core/colors/red';

const theme = createMuiTheme({
  palette: {
    primary: {
      main: red[600]
    },
    background: {
      default: red[300]
    }
  }
});

class App {
  backgroundSetup() {
    <div style={{
        backgroundColor: theme.palette.background.default,
        minHeight: window.innerHeight
      }}>
    </div>
  }
}

export default App;
